import React from 'react'
import { useState } from 'react'

window.minPriceTracker = 0;
window.maxPriceTracker = 0;
window.errorMessage = "Please enter at least one search criterion.";
window.isSearchButtonDisabled = true;


function isNullOrEmpty(stringInput) {
  if (stringInput === null || stringInput.toString().trim() === "") {
    return true;
  } else {
    return false;
  }
}

function checkMinAndMax(event) {
  if (event.target.id == 'min_price') {
    window.minPriceTracker = parseInt(event.target.value);
  }
  if (event.target.id == 'max_price') {
    window.maxPriceTracker = parseInt(event.target.value);
  }
  if (window.minPriceTracker == 0 && window.maxPriceTracker == 0) {
    console.log("1");
    window.errorMessage = "Please choose a minimum or maximum price."
    window.isSearchButtonDisabled = true;
  }
  else if (window.minPriceTracker > window.maxPriceTracker) {
    console.log("2");
    window.errorMessage = "Maximum price must be greater than minumum price."
    window.isSearchButtonDisabled = true;
  }
  else if (window.maxPriceTracker == 0) {
    console.log("3");
    window.errorMessage = "Maximum price must be greater than $0"
    window.isSearchButtonDisabled = true;
  }
  else {
    console.log("4");
    window.errorMessage=""
    window.isSearchButtonDisabled = false;
  }
}

function search() {
  const [state, setState] = useState({
    minPriceTracker: "",
    maxPriceTracker: "",
    errorMessage: "",
    isSearchButtonDisabled: false
  });
  return (
    <div>
      <h1> Search </h1>

      <form id="search-form" method="POST">
        <label htmlFor="address">Address</label>
        <input name="address" id="address" placeholder="Address" type="text" />
        <label htmlFor="min_price">Minimum Price</label>
        <input name="min_price" id="min_price" placeholder="Minimum price" type="number" value={minPriceTracker} onBlur={(minPrice) => {
          minPriceTracker = minPrice.target.value;
        }} />
        <label htmlFor="max_price">Maximum Price</label>
        <input name="max_price" id="max_price" placeholder="Maximum price" type="number" onBlur={(maxPrice) => {
          maxPriceTracker = maxPrice.target.value;
        }} />
        <label htmlFor="numBedrooms"># of Bedrooms</label>
        <select id="numBedrooms" name="numBedrooms" defaultValue="">
            <option value="" disabled>Select Beds</option>
            <option value="noselection">No Selection</option>
            <option value="1">1 Bed</option>
            <option value="2">2 Beds</option>
            <option value="3">3 Beds</option>
            <option value="4">4 Beds</option>
            <option value="5">5 Beds</option>
        </select>
        <label htmlFor="numBathrooms"># of Bathrooms</label>
        <select id="numBathrooms" name="numBathrooms" defaultValue="">
            <option value="" disabled>Select Beds</option>
            <option value="noselection">No Selection</option>
            <option value="1">1 Bed</option>
            <option value="2">2 Beds</option>
            <option value="3">3 Beds</option>
            <option value="4">4 Beds</option>
            <option value="5">5 Beds</option>
        </select>
        <div id="errorMessage">{errorMessage}</div>
        <button type="submit" disabled={isSearchButtonDisabled}> Search </button>
      </form>
    </div>
  )
}

export default search
